import { DataBase } from './DataBase';
/**
 * 设备数据类
 * Rainbow启动都监听getSystemInfoSuccess消息，回调后可以调用方法才可以得到正确的值
 */
export default class DataDevice extends DataBase {
    protected constructor();
    private static _instance;
    static getInstance(): DataDevice;
    /**
     * 返回设备品牌
     */
    getBrand(): string;
    /**
     * 返回型号
     */
    getModel(): string;
    /**
     * 返回像素比
     */
    getPixelRatio(): number;
    /**
     * 返回屏幕宽度，单位px
     */
    getScreenWidth(): number;
    /**
     * 返回屏幕高度，单位px
     */
    getScreenHeight(): number;
    /**
     * 返回可使用窗口宽度，单位px
     */
    getWindowWidth(): number;
    /**
     * 返回可使用窗口高度，单位px
     */
    getWindowHeight(): number;
    /**
     * 返回状态栏的高度，单位px
     */
    getStatusBarHeight(): number;
    /**
     * 返回美团设置的语言
     */
    getLanguage(): string;
    /**
     * 返回美团版本号
     */
    getVersion(): string;
    /**
     * 返回操作系统及版本
     */
    getSystem(): string;
    /**
     * 返回客户端平台
     * 返回值为小写 (ios/android)
     */
    getPlatform(): string;
    /**
     * 返回客户端基础库版本
     */
    getSDKVersion(): string;
    /**
     * 设置mgcId
     * @param mgcId
     */
    setMgcId(mgcId: string): void;
    /**
     * 返回mgcId 小游戏用户唯一id
     * 不存在则为null
     */
    getMgcId(): string;
    /**
     * 设置美团UserId
     * @param mtUserId
     */
    setMtUserId(mtUserId: string): void;
    /**
     * 返回美团UserId
     * 需要调用LoginSDK.getInstance().login的回调后才能正常获取值
     * 美团11.7.200及以上支持
     * 未支持时返回null
     */
    getMtUserId(): string;
    /**
     * 设置美团token
     * @param mtToken
     */
    setMtToken(mtToken: string): void;
    /**
     * 返回美团token
     * 需要调用LoginSDK.getInstance().login的回调后才能正常获取值
     * 美团11.7.200及以上支持
     * 未支持时返回null
     */
    getMtToken(): string;
    /**
     * 返回 uuid
     * 美团版本11.3.200支持，未支持时返回null
     */
    getUuid(): string;
    /**
     * 此值一般情况下无用，设备标识应该是用uuid
     * 仅android
     * 11.3.200支持
     */
    getDeviceId(): string;
    /**
     * 返回指纹
     * 11.3.200支持
     */
    getFingerprint(): string;
    /**
     * 返回首页选择城市ID
     * 11.3.400支持
     */
    getCityId(): string;
    /**
     * 返回定位城市ID
     * 11.3.200支持
     */
    getLocalCityId(): string;
    /**
     * 返回游戏版本号
     * 11.3.200支持
     */
    getGameVersion(): string;
    /**
     * 返回AppId
     * 11.3.200支持
     */
    getAppId(): string;
    /**
     * 返回AppName
     * 11.3.200支持
     */
    getAppName(): string;
    /**
     * 返回是否正在提审
     * 仅iOS有效
     * 11.7.200支持
     */
    isPreview(): boolean;
    /**
     * 返回IDFA值
     * 仅iOS有效
     * 11.3.200支持
     */
    getIdfa(): any;
    /**
     * 返回IDFV值
     * 仅iOS有效
     * 11.3.200支持
     */
    getIdfv(): any;
    /**
     * 返回IMEI值
     * 仅Android有效
     * 11.3.200支持
     */
    getImei(): any;
    /**
     * 返回容器宿主，默认返回为'meituan'
     * 目前还没有对web游戏适配处理，只支持小游戏
     * 11.20.200支持
     */
    getAppType(): any;
}
